body:
@benyoka Good point.

Although changing `core-site` triggers "Restart required" for Hive components, it looks like `core-site.xml` is not saved during restart.  I guess the logic to save `core-site.xml` should be explicitly added to Hive Metastore's script instead of tweaking the hook.

(Note that `core-site` config can be changed only via API.  It is not exposed on UI, since HDFS is not installed.)
